import React from 'react';
import {connect} from "react-redux";
import {withRouter} from "react-router-dom"
import {compose} from "redux";
import NewPizzaOrder from "./NewPizzaOrder";
import {newItem} from "../../../../Redux/later-seen-reducer";


class NewPizzaOrderContainer extends React.Component {


    render() {
        this.props.newItem(this.props.pizza[this.props.match.params.id - 41], this.props.ves, this.props.size)

        return (
            <NewPizzaOrder pizza={this.props.pizza} number={this.props.match.params.id - 41} size={this.props.size}
                           ves={this.props.ves}/>
        )
    }
}


let mapStateToprops = (state) => {

    return {
        pizza: state.newPizzaPage.pizza,
        size: state.newPizzaPage.siza,
        ves: state.newPizzaPage.ves,


    }


}

export default compose(
    connect(mapStateToprops, {newItem}),
    withRouter,
)(NewPizzaOrderContainer)
